import React from 'react';
const mapbox = require('mapbox-gl/dist/mapbox-gl.js');

interface MapProps {}

const Map: React.FC<MapProps> = ({}: MapProps) => {
  mapbox.accessToken =
    'pk.eyJ1Ijoic2VzY2h3YXJ0ejgiLCJhIjoiY2s5aW83cXNxMWJ1MTNrbGxzaW55YmFqbCJ9.Wcju4UV4OLz90abpY6HtuA';
  const finalMap = new mapbox.Map({
    container: 'mapDiv',
    style: 'mapbox://styles/seschwartz8/ck9ioaqt300q41jqpgdm3ciln',
    zoom: 0.5,
    minZoom: 0.5,
    maxZoom: 12,
    center: [-100, 35],
  });

  return (
    <div>
      <div>{finalMap}</div>
    </div>
  );
};

export default Map;
